import React from "react";
import FriendsList from "../friendsList";
import GroupBox from "../groupBox";
import photo12 from "../images/photo12.png";
import photo13 from "../images/photo13.png";
import photo14 from "../images/photo14.png";
import photo15 from "../images/photo15.png";
import photo16 from "../images/photo16.png";
import photo17 from "../images/photo17.png";

function Groups() {
  return (
    <div className="groups">
      <div class="container">
        {/* center items!!! */}
        <div class="align-items-center">
          <Button variant="outline-success" size="sm">
            Create New Group +
          </Button>{" "}
          <hr />
          <div class="row align-items-center mt-5 mb-2">
            <h1 class="font-weight-bold col-lg-4">Suggested Groups</h1>
          </div>
          <div class="row col-lg-9 pb-5">
            <div class="col-lg-4">
              <GroupBox link={photo13} groupName="Hogwarts" />
            </div>
            <div class="col-lg-4">
              <GroupBox link={photo14} groupName="Puppies" />
            </div>
            <div class="col-lg-4">
              <GroupBox link={photo15} groupName="Astronomy" />
            </div>
          </div>
          <div class="row col-lg-9 pb-5">
            <div class="col-lg-4">
              <GroupBox link={photo16} groupName="Candy" />
            </div>
            <div class="col-lg-4">
              <GroupBox link={photo17} groupName="Books" />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Groups;
